import React, { Component } from 'react';
import { Badge, Card, CardBody, CardHeader, Col, Pagination, PaginationItem, PaginationLink, Row, Table } from 'reactstrap';
const axios = require('axios');
class UserToUser extends Component {
  state = { listUserToUser: [] }
  componentDidMount() {
    let self = this;
    axios.get('/transaction/usertouser/listUserToUser')
      .then(function (response) {
        // handle success
        let details = [];
        temp = new mongoose.Schema({
          Name: String,
          Target: String,
          Money: String,
          Description: String,
          DateGet: String,
          UrlFull: String
         });
        for (var i in response.data) {
          details.push({ name: i, value: response.data[i] })
        }

        self.setState({ listUserToUser: details })
        console.log(self.state.listUserToUser);
      })
      .catch(function (error) {
        // handle error
        console.log(error);
      })
      .then(function () {
        // always executed
      });
  }
  render() {
    return (
      <div className="animated fadeIn">
        <Row>
          <Col xs="12" lg="12">
            <Card>
              <CardHeader>
                <i className="fa fa-align-justify"></i> Simple Table
              </CardHeader>
              <CardBody>
                <Table responsive>
                  <thead>
                    <tr>
                      <th>Name</th>
                      <th>Target</th>
                      <th>Money</th>
                      <th>Description</th>
                      <th>DateGet</th>
                      <th>URL_FULL</th>
                    </tr>
                  </thead>
                  <tbody>
                    {this.state.listUserToUser.map(user =>
                      <tr>
                        <td key={user.id}>{user.Name}</td>
                        <td key={user.id}>{user.Name}</td>
                        <td key={user.id}>{user.Name}</td>
                        <td key={user.id}>{user.Name}</td>
                        <td key={user.id}>{user.Name}</td>
                        <td key={user.id}>{user.Name}</td>
                      </tr>
                    )}
                  </tbody>
                </Table>
                <Pagination>
                  <PaginationItem>
                    <PaginationLink previous tag="button"></PaginationLink>
                  </PaginationItem>
                  <PaginationItem active>
                    <PaginationLink tag="button">1</PaginationLink>
                  </PaginationItem>
                  <PaginationItem>
                    <PaginationLink tag="button">2</PaginationLink>
                  </PaginationItem>
                  <PaginationItem>
                    <PaginationLink tag="button">3</PaginationLink>
                  </PaginationItem>
                  <PaginationItem>
                    <PaginationLink tag="button">4</PaginationLink>
                  </PaginationItem>
                  <PaginationItem>
                    <PaginationLink next tag="button"></PaginationLink>
                  </PaginationItem>
                </Pagination>
              </CardBody>
            </Card>
          </Col>
        </Row>
      </div>

    );
  }
}

export default UserToUser;
